%%--------------------------------------------------------------------
%% HELPER FUNCTIONS
%%--------------------------------------------------------------------

test_cypher(Test) ->
    % ?debugFmt("wwe debugging test_cypher/1 ===> ~n Test: ~p~n", [Test]),
    case ocparse:parsetree_with_tokens(Test) of
        {ok, {ParseTree, Tokens}} ->
            % ?debugFmt("wwe debugging test_cypher/1 ===> ~n ParseTree: ~p~n Tokens: ~p~n", [ParseTree, Tokens]),
            %% --------------------------------------------------------
            %% Test TopDown
            %% --------------------------------------------------------
            NCypherTD = case ocparse:pt_to_string_td(ParseTree) of
                            {error, ErrorTD} ->
                                throw({error, ErrorTD});
                            NSTD ->
                                % ?debugFmt("wwe debugging test_cypher/1 ===> ~n Test TopDown: ~p~n NS: ~p~n", [NSTD]),
                                NSTD
                        end,
            {ok, {NPTreeTD, NToksTD}}
                = try
                      {ok, {NPTTD, NTTD}} = ocparse:parsetree_with_tokens(NCypherTD),
                      {ok, {NPTTD, NTTD}}
                  catch _:_ ->
                ?debugFmt("wwe debugging test_cypher/1 ===> ~n Test TopDown: ~p~n NCypherTD: ~p~n", [Test, NCypherTD])
                  end,
            try
                ParseTree = NPTreeTD
            catch
                _:_ ->
                    ?debugFmt("wwe debugging test_cypher/1 ===> ~n Test TopDown: ~p~n ParseTree: ~p~n NPTree: ~p~n Tokens: ~p~n NToks: ~p~n", [Test, ParseTree, NPTreeTD, Tokens, NToksTD])
            end,
            ?assertEqual(ParseTree, NPTreeTD),
            %% --------------------------------------------------------
            %% Test BottomUp
            %% --------------------------------------------------------
            NCypherBU = case ocparse:pt_to_string_bu(ParseTree) of
                            {error, ErrorBU} ->
                                throw({error, ErrorBU});
                            NSBU ->
                                % ?debugFmt("wwe debugging test_cypher/1 ===> ~n Test BottomUp: ~p~n NS: ~p~n", [NSBU]),
                                NSBU
                        end,
            {ok, {NPTreeBU, NToksBU}}
                = try
                      {ok, {NPTBU, NTBU}} = ocparse:parsetree_with_tokens(NCypherBU),
                      {ok, {NPTBU, NTBU}}
                  catch _:_ ->
                ?debugFmt("wwe debugging test_cypher/1 ===> ~n Test BottomUp: ~p~n NCypher: ~p~n", [Test, NCypherBU])
                  end,
            try
                ParseTree = NPTreeBU
            catch
                _:_ ->
                    ?debugFmt("wwe debugging test_cypher/1 ===> ~n Test BottomUp: ~p~n ParseTree: ~p~n NPTree: ~p~n Tokens: ~p~n NToks: ~p~n", [Test, ParseTree, NPTreeBU, Tokens, NToksBU])
            end,
            ?assertEqual(ParseTree, NPTreeBU);
        {lex_error, ErrorBU} ->
            ?debugFmt("wwe debugging test_cypher/1 ===> Failed lexer~n Test BottomUp: ~p~n Error: ~p~n", [Test, ErrorBU]),
            ?assertEqual(ok, ErrorBU);
        {lex_error, ErrorTD} ->
            ?debugFmt("wwe debugging test_cypher/1 ===> Failed lexer~n Test TopDown: ~p~n Error: ~p~n", [Test, ErrorTD]),
            ?assertEqual(ok, ErrorTD);
        {parse_error, {ErrorBU, Tokens}} ->
            ?debugFmt("wwe debugging test_cypher/1 ===> Failed parser~n Test BottomUp: ~p~n Error: ~p~n Tokens: ~p~n", [Test, ErrorBU, Tokens]),
            ?assertEqual(ok, ErrorBU);
        {parse_error, {ErrorTD, Tokens}} ->
            ?debugFmt("wwe debugging test_cypher/1 ===> Failed parser~n Test TopDown: ~p~n Error: ~p~n Tokens: ~p~n", [Test, ErrorTD, Tokens]),
            ?assertEqual(ok, ErrorTD)
    end.
